import React, {Component, Fragment} from 'react';
import {
    Row, Col,
    CardTitle,
    Progress,

} from 'reactstrap';

import {
    ResponsiveContainer,
    LineChart,
    Tooltip,
    Line
} from 'recharts';


export default class IncomeReport extends Component {
    constructor() {
        super();
    }
    render() {
        return (
            <Fragment>
            <div className="widget-chart-wrapper widget-chart-wrapper-lg opacity-10 m-0">
            <ResponsiveContainer width="100%" height={240}>
            <table>
            <tr>
            <td>
            Dandi
            </td>
            </tr>
            </table>
            </ResponsiveContainer>
            </div>
            <CardTitle>
            Target Sales
            </CardTitle>
            <Row className="mt-3">



            </Row>
            </Fragment>
            )
    }
}
